import React, { useState } from "react";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
          minHeight: "100vh",
          background: "linear-gradient(135deg,rgb(72, 255, 0), #FF8C00, #FFD700)",
          color: "#FFFFFF",
          padding: "40px",
          textAlign: "center",
          fontFamily: "'Roboto', sans-serif",
          boxShadow: "0 6px 15px rgba(0, 0, 0, 0.3)",
          animation: "fadeIn 1.5s ease-out",
        }}
      >
        <Switch>
          {/* Home Route */}
          <Route exact path="/">
            <HomePage />
          </Route>

          {/* To-Do List Route */}
          <Route path="/todo">
            <ToDoList />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function HomePage() {
  return (
    <div>
      <img
        src="https://staticg.sportskeeda.com/editor/2023/10/863b8-16965197990729-1920.jpg" 
        alt="Header Image"
        style={{
          width: "100%",
          maxWidth: "500px",
          borderRadius: "15px",
          marginBottom: "30px",
          boxShadow: "0 4px 12px rgba(0, 0, 0, 0.3)",
        }}
      />
      <h1 style={{ fontSize: "48px", fontWeight: "800", marginBottom: "20px" }}>
        SEAN DIAZ
      </h1>
      <h2 style={{ fontSize: "28px", fontWeight: "600", marginBottom: "20px" }}>
        ABOUT ME:
      </h2>
      <p style={{ fontSize: "20px", maxWidth: "650px", opacity: 0.9 }}>
        ↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓↓
      </p>
      <div
        style={{
          marginTop: "30px",
          padding: "20px",
          borderRadius: "12px",
          backgroundColor: "rgba(255, 255, 255, 0.15)",
          backdropFilter: "blur(10px)",
          boxShadow: "2px 2px 20px rgba(0, 0, 0, 0.4)",
        }}
      >
        <h3 style={{ fontSize: "24px", fontWeight: "700", marginBottom: "12px" }}>
          Skills:
        </h3>
        <ul style={{ listStyleType: "none", padding: 0, fontSize: "18px" }}>
          <li>✔ WALA</li>
          <li>✔ WALA</li>
          <li>✔ WALA</li>
          <li>✔ WALA</li>
          <li>✔ WALA NGA!</li>
        </ul>
      </div>

      {/* Link to To-Do List Page */}
      <Link to="/todo">
        <button
          style={{
            marginTop: "20px",
            backgroundColor: "#FF6347",
            color: "#FFFFFF",
            padding: "12px 20px",
            fontSize: "18px",
            fontWeight: "bold",
            border: "none",
            borderRadius: "8px",
            cursor: "pointer",
            transition: "background-color 0.3s ease",
          }}
        >
          Go to To-Do List
        </button>
      </Link>
    </div>
  );
}

function ToDoList() {
  const [task, setTask] = useState("");
  const [tasks, setTasks] = useState([]);

  const addTask = () => {
    if (task) {
      setTasks([...tasks, task]);
      setTask("");
    }
  };

  const removeTask = (index) => {
    setTasks(tasks.filter((_, i) => i !== index));
  };

  return (
    <div
      style={{
        marginTop: "30px",
        padding: "20px",
        borderRadius: "12px",
        backgroundColor: "rgba(255, 255, 255, 0.15)",
        backdropFilter: "blur(10px)",
        boxShadow: "2px 2px 20px rgba(0, 0, 0, 0.4)",
        textAlign: "center",
      }}
    >
      <h3 style={{ fontSize: "24px", fontWeight: "700", marginBottom: "12px" }}>
        To-Do List
      </h3>

      {/* Input Field */}
      <div style={{ marginBottom: "15px" }}>
        <input
          type="text"
          value={task}
          onChange={(e) => setTask(e.target.value)}
          placeholder="Add a new task"
          style={{
            width: "100%",
            padding: "12px",
            fontSize: "18px",
            borderRadius: "8px",
            backgroundColor: "#FFFFFF",
            color: "#333",
            border: "none",
            marginBottom: "10px",
          }}
        />
      </div>

      <button
        onClick={addTask}
        style={{
          backgroundColor: "#FF6347",
          color: "#FFFFFF",
          padding: "12px 20px",
          fontSize: "18px",
          fontWeight: "bold",
          border: "none",
          borderRadius: "8px",
          cursor: "pointer",
        }}
      >
        Add Task
      </button>

      <ul
        style={{
          listStyleType: "none",
          padding: 0,
          marginTop: "20px",
          fontSize: "18px",
        }}
      >
        {tasks.map((task, index) => (
          <li key={index} style={{ marginBottom: "10px" }}>
            {task}{" "}
            <button
              onClick={() => removeTask(index)}
              style={{
                marginLeft: "10px",
                backgroundColor: "#FF4500",
                color: "#FFFFFF",
                border: "none",
                borderRadius: "8px",
                padding: "5px 10px",
                cursor: "pointer",
              }}
            >
              Remove
            </button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
